import React from "react";
import "./chatbot.css";
import VerifiedUserIcon from "@mui/icons-material/VerifiedUser";
const chatbot = () => {
  return (
    <div className="chatbot">
      <div className="chatbot__header">
        <h2>Chatbot</h2>
        <VerifiedUserIcon/>
      </div>
      {/* <h2 className="pageTitle">Welcome to Chatbot</h2> */}
    </div>
  );
};

export default chatbot;
